import "./NavbarStyles.css"

import React from 'react'
import { Link } from "react-router-dom"


const Navbar = () => {
  return (
    <div className="header">
       <Link to="/">
            Explore Rahovec
       </Link>
    </div>
  )
}

export default Navbar
